import axios from "axios";
import React, { useEffect, useState } from "react";

function App() {
  const [musics, setMusics] = useState([]);
  useEffect(() => {
    axios
      .get("http://localhost:5001")
      .then((res) => console.log(res.data, "res"))
      .catch((err) => {
        console.log(err, "errr");
      });
  }, []);

  return <div>App</div>;
}

export default App;
